import React from 'react';
import { BrowserRouter ,Routes,Route } from "react-router-dom";
import Navbar from './Navbar';
import Footer from './Footer';

function App (){
  return (
  <BrowserRouter>
    <Routes>
    <Route path="/Navbar" element={<Navbar/>}/>
    <Route path="/Footer" element={<Footer/>}/>
    </Routes>
</BrowserRouter>
  );
}

export default App;
